import React from 'react'
import CarouselPage from '../functional/Carousel'

const LandingPage = () => {
    return (
        <div className="container">
            <h1>Discover the world and create your own itinerary</h1>
            <CarouselPage />
        </div>
    )
}

export default LandingPage;
